DROP TABLE IF EXISTS "Pokemon";
CREATE TABLE Pokemon (Number INTEGER PRIMARY KEY, Name TEXT, Type1 INTEGER, Type2 INTEGER, Male REAL, Female REAL, WeightClass INTEGER, Size TEXT, BaseHP INTEGER, BaseAtk INTEGER, BaseDef INTEGER, BaseSpAtk INTEGER, BaseSpDef INTEGER, BaseSpeed INTEGER, NumberEvols INTEGER, Capabilities TEXT, Skills TEXT, MinimumLevel INTEGER, FOREIGN KEY (Type1) REFERENCES Types (TypeID), FOREIGN KEY (Type2) REFERENCES Types (TypeID));
